INSERT INTO `cms_article` VALUES ('7', '4', '挑选翡翠手镯的五个原则是什么？', '', '', '', '挑选 翡翠 手镯 原则', '翡翠手镯因着端庄古朴的外表，珍贵的收藏价值而深受人们的喜欢。不过，翡翠手镯虽好，却并不容易购买，很多时候我们花了大价钱买到的翡翠手镯，竟是一些行家眼中的次品。现在我们就来介绍一下行家挑选翡翠手镯的五个原则。', '0', null, '0', ',null,', '', '', '1', '2013-05-27 08:00:00', '1', '2018-05-04 11:03:43', null, '0');
